    def ReadPFC(self):
        SectionHead = PFCRead("PFC 1 PFC")
        self.pfc11_combo.setCurrentText(SectionHead['p_load'])
        self.pfc12_combo.setCurrentText(SectionHead['r_phase'])
        self.pfc13_combo.setCurrentText(SectionHead['n_p_load_1'])
        self.pfc14_combo.setCurrentText(SectionHead['y_phase'])
        self.pfc15_combo.setCurrentText(SectionHead['n_p_load_2'])
        self.pfc16_combo.setCurrentText(SectionHead['b_phase'])
        self.pfc17_combo.setCurrentText(SectionHead['n_p_load_3'])
        self.pfc18_combo.setCurrentText(SectionHead['bus'])
        self.pfc19_combo.setCurrentText(SectionHead['n_p_load_4'])
        self.pfc110_combo.setCurrentText(SectionHead['load_mains'])
